# Complete the isValid function below.
def isValid(s):
    ct = [0]*26
    for ch in s:
        ct[ord(ch)-ord('a')] += 1
    cts = []
    for i in range(26):
        if ct[i] > 0:
            cts.append(ct[i])
    cts = sorted(cts)
    if len(cts) < 2:
        return 'YES'
    if ct[0] < ct[1]:
        for i in range(1, len(cts)-1):
            if ct[i] != ct[i+1]:
                return 'NO'
        return 'YES'
    for i in range(len(cts)-1):
        if ct[i+1] - ct[i] > 1:
            return 'NO'
    if len(cts) != 2:
        return 'NO'
    valid = cts[0] == 1 or cts[1] == cts[0] or cts[1] - cts[0] == 1
    return 'YES' if valid else 'NO'


if __name__ == '__main__':
    s = ""
    print(isValid(s))
